activityDescription:
Gegenstand des Unternehmens sind alle Arten von Dienstleistungen im Rahmen der Verarbeitung tierischer Nebenprodukte und wirtschaftliche Tätigkeiten für diese Industrie, insbesondere

1. die Unterstützung von Einzelinteressen gegenüber Parlamenten, Behörden und Organisationen sowie der Öffentlichkeit und Vertragspartnern, die nicht zu den Verarbeitungsbetrieben für tierische Nebenprodukte gehören;
2. der Austausch wirtschaftlicher, wissenschaftlicher und technischer Erkenntnisse und Erfahrungen im Rahmen der Verarbeitung tierischer Nebenprodukte (regelmäßige Informationen, Veranstaltungen von Tagungen usw.);
3. die Beratung bei hygienischen, technologischen, wirtschaftlichen und rechtlichen Problemen sowie in Fragen des Umweltschutzes;
4. das Eintreten für einen lauteren Wettbewerb innerhalb der Verarbeitung tierischer Nebenprodukte;
5. Informationen über die Entwicklung der Märkte für die Erzeugnisse aus tierischen Nebenprodukten zu sammeln und zugänglich zu machen;
6. Forschungsaufträge über die Herstellung und Verwendung der Erzeugnisse aus tierischen Nebenprodukten zu vergeben;
7. den Kontakt zu den Verbrauchern der Erzeugnisse aus tierischen Nebenprodukten, zu den Trägern der Fütterungslehre, der Forschung und den Organisationen der Landwirtschaft zu pflegen;
8. die Eingehung von Mitgliedschaften in Organisationen auf nationaler und internationaler Ebene
